The defendant is sentenced to the Wisconsin State Prison system for a total of sixty (60) months.  That is twenty-four (24) months initial confinement followed by thirty-six (36) months extended supervision.
The defendant is not eligible for the Challenge Incarceration Program and is eligible for the Substance Abuse Program.
The defendant has credit for 1 day.
Conditions of extended supervision:
1) Pay court costs;
2) pay supervision fees in an amount to be determined by DOC;
3) have no contact with the victims family;
4) assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
5) no contact with any known drug users or dealers;
6) maintain fulltime employment or work search as directed by the agent;
7) Submit to random urine screens and pay for same;
8) Comply with electronic monitoring if approved/ordered;
9) Pay the balance of restitution owing, joint and several with the co-defendant, Jennifer Moede.  The total restitution amount is $5,773.08.  $3,500.00 was already paid from cash bail on the co-defendants case, plus the co-defendant has already paid an additional $19.00.  The balance owing is $2,254.08 which is ordered to be paid from the cash bail on file.  (per JLF  use the $7,500 cash bail to pay the balance)
The Court orders that once the restitution is paid, the remaining cash bail is to be returned to whoever furnished it and should not be applied to court costs.
